import './App.css';
import NavBar from './components/NavBar';
import RecipeList from './components/RecipeList';
import Login from './components/Login';
import SignUp from './components/SignUp';

function App() {
  return (
    <div className="App">
      <SignUp />
      <NavBar />
      <Login />
      <RecipeList />
    </div>
  );
}

export default App;
